const initState = {
    todoDescription: '',
    todoResponseble: '',
    todoPriority: '',
    todoCompleted: false
};

const createTodo = (state = initState, action) => {
    switch (action.type) {
        case 'changeTodoDescription':
            return {
                ...state,
                todoDescription: action.description,
            };
        case 'changeTodoResponseble':
            return {
                ...state,
                todoResponseble: action.responseble,
            }
        case 'changeTodoPriority':
            return {
                 ...state,
                todoPriority: action.priority,
            }
        case 'submit':
            console.log(`Todo submoted: ${state.todoDescription}`);

            return state;
        default:
            return state;
    }
}

export default createTodo;
